import React from 'react';

const statusStyles = {
  'Try Again': { bg: '#7c3aed', dot: '#7c3aed', color: '#fff' },
  'Pass': { bg: '#fb923c', dot: '#fb923c', color: '#fff' },
  'Active': { bg: '#22c55e', dot: '#22c55e', color: '#fff' },
  'Draft': { bg: '#fff', dot: '#64748b', color: '#23272e', border: '1px solid #e5e7eb' },
  'Hide': { bg: '#d1d5db', dot: '#d1d5db', color: '#23272e' },
  'Not Started': { bg: '#d1d5db', dot: '#d1d5db', color: '#23272e' },
};

const VideoCard = ({ video, onPlay, cardHeight }) => {
  const status = video.statusBtn;
  const style = statusStyles[status] || { bg: '#64748b', dot: '#64748b', color: '#fff' };
  return (
    <div style={{
      background:'#fff',
      borderRadius:18,
      boxShadow:'0 2px 8px -2px #a855f722',
      padding:'1.25rem',
      display:'flex',
      flexDirection:'column',
      alignItems:'center',
      minWidth:260,
      maxWidth: '100%',
      margin:'0.5rem',
      height: cardHeight === 'stretch' ? '100%' : undefined
    }}>
      <img src={video.image} alt={video.title} style={{width:'100%',height:120,objectFit:'cover',borderRadius:12,marginBottom:'1rem'}} />
      <div style={{fontWeight:700,fontSize:'1.25rem',color:'#23272e',marginBottom:'0.5rem',display:'flex',alignItems:'center',width:'100%',justifyContent:'space-between'}}>
        <span>{video.title}</span>
        <span style={{fontSize:'1.5rem',color:'#23272e',cursor:'pointer',padding:'0 0.25rem'}}>⋮</span>
      </div>
      <div style={{display:'flex',alignItems:'center',gap:'0.75rem',marginBottom:'0.25rem',fontSize:'1.05rem'}}>
        <span style={{color:'#7c3aed',display:'flex',alignItems:'center'}}>
          <img src={require('c:/Users/ACER NITRO5/Downloads/Clock.png')} alt="clock" style={{width:18,height:18,marginRight:3,verticalAlign:'middle'}} />
          {video.duration} น.
        </span>
        <span style={{color:'#fb923c',display:'flex',alignItems:'center'}}>
          <img src={require('c:/Users/ACER NITRO5/Downloads/FireSimple.png')} alt="fire" style={{width:18,height:18,marginRight:3,verticalAlign:'middle'}} />
          {video.kcal} Kcal
        </span>
      </div>
      <div style={{color:'#23272e',fontSize:'1.05rem',marginBottom:'0.25rem'}}>Score: <span style={{fontWeight:700}}>{video.score ?? '-'}%</span></div>
      {status && (
        <span style={{
          display:'inline-flex',alignItems:'center',background:style.bg,color:style.color,fontWeight:700,borderRadius:8,padding:'0.25rem 0.95rem',fontSize:'1rem',marginBottom:'0.7rem',boxShadow:'0 1px 4px #a855f722',border:style.border || 'none',letterSpacing:0.2
        }}>
          <span style={{display:'inline-block',width:12,height:12,borderRadius:'50%',background:style.dot,marginRight:8}}></span>
          {status}
        </span>
      )}
      <button onClick={onPlay} style={{width:'100%',background:'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)',color:'#fff',fontWeight:700,border:'none',borderRadius:12,padding:'0.7rem 0',fontSize:'1.15rem',marginTop:'0.5rem',cursor:'pointer',display:'flex',alignItems:'center',justifyContent:'center',gap:8}}>
        <svg width="22" height="22" fill="none" xmlns="http://www.w3.org/2000/svg"><circle cx="11" cy="11" r="11" fill="#fff" fillOpacity="0.18"/><path d="M9.5 8.5v5l4-2.5-4-2.5Z" fill="#fff"/></svg>
        Play
      </button>
    </div>
  );
};

export default VideoCard;
